window.bookSummaryJSON = "<p>“If you love a <i>Law &amp; Order</i> marathon and binged <i>True Detective</i> in one go, <i>Exeter </i>might be your new favorite podcast.” (<i>The New York Times</i>)</p> <p>Following the shocking reveals of season one, Colleen and Pruitt are forced to reopen a highly controversial cold case, which happens to be one Colleen could never solve. During the investigation into the murder of a pair of beloved local teens, they are forced to investigate their own friends and family. In order to finally put the case to rest, they must find new leads from an eight-year-old case, sift through long-buried secrets, and get to the shocking truth of what really happened.</p> <p>Season two of hit crime podcast <i>Exeter </i>reunites Jeanne Tripplehorn (<i>Big Love</i>, <i>Criminal Minds</i>), Ray McKinnon (<i>Dopesick</i>, <i>Sons of Anarchy</i>), and an all-star cast.</p> <p>Note: Listeners do not have to start <i>Exeter </i>on season one. There is progression from season to season, but each season can stand on its own and does not have to be listened to in order.</p>"; 
